- input: "TEXT\x1CC90005786\x1C1\x1C\x1CF5N\x1CLeague of Conservation Voters, Inc
    received no contributions during the 2013 April Quarterly Period made for the
    purpose of furthering an independent expenditure.  The source of funding for the
    independent expenditures reported on the Form 5 are from LCVs general treasury
    funds.  LCV is therefore reporting zero receipts on line 6 of this report.  This
    2013 April Quarterly Form 5 report YTD will reflect an increase of $2,136.17.
    \ This increase is the difference between the actual payment of $4,636.17 for
    a March 1, 2013 entry that was previously reported as an estimate of $2,500.00
    on a 48 hour report pertaining to the Massachusetts Senate Special Primary.  This
    adjustment will also cause the aggregate YTD for the Massachusetts Senate Special
    Primary to increase by $2,136.17 on the next 24 or 48 hour report filed by LCV
    Inc. for this race.\n"
